INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(2, 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', 'Bệnh viện Hữu nghị Việt Đức', '<p><strong>GIỚI THIỆU</strong>\n<strong>Địa chỉ</strong>:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p>\n<ul>\n<li>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội</li>\n</ul>\n<p><strong>Thời gian làm việc</strong>:</p>\n<ul>\n<li>Thứ 2 đến thứ 7</li>\n<li>Sáng: 7h00 - 12h00</li>\n<li>Chiều: 13h30 - 16h30</li>\n</ul>\n<p>Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n<p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<ul>\n<li>Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.</li>\n<li>Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.</li>\n<li>Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.</li>\n</ul>\n<p><strong>Chi phí khám</strong></p>\n<p>Người bệnh có thể lựa chọn một trong các gói khám sau:</p>\n<p>Gói 1:</p>\n<ul>\n<li>Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám</li>\n<li>Khám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám</li>\n</ul>\n<p>Gói 2:\n<strong>Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám</strong></p>\n', '**GIỚI THIỆU**\n**Địa chỉ**:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: \n\n* Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\n\n**Thời gian làm việc**: \n* Thứ 2 đến thứ 7 \n* Sáng: 7h00 - 12h00\n* Chiều: 13h30 - 16h30\n\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. \n\nViệt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. \n\nBệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. \n\n**Lưu ý quan trọng**\n\n* Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.\n* Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\n* Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.\n\n**Chi phí khám**\n\nNgười bệnh có thể lựa chọn một trong các gói khám sau:\n\nGói 1:\n* Khám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám\n* Khám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám\n\nGói 2:\n**Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám**', 'data:image/png;base64,', '2023-02-12 00:08:26', '2023-02-12 00:08:26');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(3, '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', 'Bệnh viện Chợ Rẫy', '<p><strong>GIỚI THIỆU</strong></p>\n<p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p>\n<p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p>\n<p>Địa chỉ bệnh viện:\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p>\n<p>Thời gian làm việc:\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p>\n<p>Thứ 2 đến thứ 6: từ 7h – 16h\nThứ 7: từ 7h – 11h\nSơ đồ Bệnh viện Chợ Rẫy</p>\n', '**GIỚI THIỆU**\n\nBệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.\n\nBệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.\n\nĐịa chỉ bệnh viện:\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh\n\nThời gian làm việc:\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:\n\nThứ 2 đến thứ 6: từ 7h – 16h\nThứ 7: từ 7h – 11h\nSơ đồ Bệnh viện Chợ Rẫy', 'data:image/jpeg;base64,', '2023-02-12 00:11:30', '2023-02-12 00:11:30');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(4, '20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM', 'Phòng khám Bệnh viện Đại học Y Dược 1', '<p><strong>GIỚI THIỆU</strong></p>\n<p>Phòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.</p>\n<p>Các bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và các bệnh viện uy tín khác trên địa bàn thành phố.</p>\n<p>Hơn nữa, phòng khám còn được đầu tư về hệ thống trang thiết bị thăm khám và điều trị đồng bộ. Một số thiết bị điển hình phải kể đến như: Máy chụp MRI, Máy chụp CT-Scanner, Máy đo loãng xương, các loại máy đo chức năng hô hấp,.... Vì vậy, phòng khám được rất nhiều người bệnh tin tưởng thăm khám.</p>\n<p>Địa chỉ: 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh</p>\n<p>Thời gian làm việc</p>\n<p>Thứ 2 tới thứ 6: 07h30 - 16h30\nThứ 7: 07h30 - 12h00\nLưu ý quan trọng</p>\n<p>Người bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau.\nKhi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.</p>\n', '**GIỚI THIỆU**\n\nPhòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.\n\nCác bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và các bệnh viện uy tín khác trên địa bàn thành phố.\n\nHơn nữa, phòng khám còn được đầu tư về hệ thống trang thiết bị thăm khám và điều trị đồng bộ. Một số thiết bị điển hình phải kể đến như: Máy chụp MRI, Máy chụp CT-Scanner, Máy đo loãng xương, các loại máy đo chức năng hô hấp,.... Vì vậy, phòng khám được rất nhiều người bệnh tin tưởng thăm khám.\n\nĐịa chỉ: 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh\n\nThời gian làm việc\n\nThứ 2 tới thứ 6: 07h30 - 16h30\nThứ 7: 07h30 - 12h00\nLưu ý quan trọng\n\nNgười bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau. \nKhi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.\n', 'data:image/jpeg;base64,', '2023-02-12 00:12:36', '2023-02-12 00:12:36');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(5, 'Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108 ', 'rung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108', '<p><strong>GIỚI THIỆU</strong></p>\n<p>Trung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám tổng quát. Vì vậy, Trung tâm khám sức khỏe định kỳ của bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát.</p>\n<p>Khám trực tiếp cho người bệnh tại Trung tâm là các Giáo sư, Phó Giáo sư, bác sĩ giỏi của Bệnh viện Trung ương Quân đội 108. Bên cạnh đó, hệ thống trang thiết bị hiện đại, đồng bộ, riêng biệt tạo ra sự thuận tiện cho người khám sức khỏe định kỳ.</p>\n<p>Trung tâm có nơi lấy mẫu xét nghiệm riêng biệt, người khám được ưu tiên với các xét nghiệm chụp chiếu khác, chính vì vậy người khám sẽ không phải chờ đợi quá lâu khi đi khám sức khỏe.</p>\n<p>Địa chỉ:Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108</p>\n<p>Thời gian làm việc:</p>\n<p>6h30 - 17h00 (nên đến khám trước 14h00 để kịp làm các xét nghiệm, chụp chiếu)\nKhám cá nhân: Thứ 2 - Thứ 6\nKhám đoàn và công ty: Thứ 7\nTHẾ MẠNH CHUYÊN MÔN\nHiện tại Trung tâm khám sức khỏe định kỳ có nhiều gói khác khác nhau, thuận tiện cho người bệnh lựa chọn:</p>\n<p>Gói khám sức khỏe tổng quát cơ bản\nGói khám sức khỏe tổng quát nâng cao\nGói khám sóc sức khỏe toàn diện\nGói khám sức khỏe định kỳ và tầm soát ung thư cơ bản\nGói khám sức khỏe cơ bản gồm các danh mục chung cho cả nam và nữ, các gói khám còn lại có một số danh mục được phân tách riêng rẽ cho đối tượng nam - nữ.</p>\n<p>Tất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho người bệnh tại bệnh viện sau khi lấy mẫu máu xét nghiệm.</p>\n', '\n**GIỚI THIỆU**\n\nTrung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám tổng quát. Vì vậy, Trung tâm khám sức khỏe định kỳ của bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát.\n\nKhám trực tiếp cho người bệnh tại Trung tâm là các Giáo sư, Phó Giáo sư, bác sĩ giỏi của Bệnh viện Trung ương Quân đội 108. Bên cạnh đó, hệ thống trang thiết bị hiện đại, đồng bộ, riêng biệt tạo ra sự thuận tiện cho người khám sức khỏe định kỳ. \n\nTrung tâm có nơi lấy mẫu xét nghiệm riêng biệt, người khám được ưu tiên với các xét nghiệm chụp chiếu khác, chính vì vậy người khám sẽ không phải chờ đợi quá lâu khi đi khám sức khỏe.\n\nĐịa chỉ:Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108\n\nThời gian làm việc:\n\n6h30 - 17h00 (nên đến khám trước 14h00 để kịp làm các xét nghiệm, chụp chiếu)\nKhám cá nhân: Thứ 2 - Thứ 6\nKhám đoàn và công ty: Thứ 7\nTHẾ MẠNH CHUYÊN MÔN\nHiện tại Trung tâm khám sức khỏe định kỳ có nhiều gói khác khác nhau, thuận tiện cho người bệnh lựa chọn:\n\nGói khám sức khỏe tổng quát cơ bản\nGói khám sức khỏe tổng quát nâng cao\nGói khám sóc sức khỏe toàn diện\nGói khám sức khỏe định kỳ và tầm soát ung thư cơ bản\nGói khám sức khỏe cơ bản gồm các danh mục chung cho cả nam và nữ, các gói khám còn lại có một số danh mục được phân tách riêng rẽ cho đối tượng nam - nữ.\n\nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho người bệnh tại bệnh viện sau khi lấy mẫu máu xét nghiệm.', 'data:image/jpeg;base64,', '2023-02-12 00:14:06', '2023-02-12 00:14:06');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(6, '34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội', 'Bệnh viện Ung bướu Hưng Việt', '<p><strong>GIỚI THIỆU</strong></p>\n<p>Địa chỉ: Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội</p>\n<p>Thời gian làm việc: Tất cả các ngày trong tuần (kể cả ngày lễ Tết)</p>\n<p>Buổi sáng: 07h00 - 12h00\nBuổi chiều: 13h30 - 17h00\nBệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế.</p>\n<p>Điểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.</p>\n<p>Sự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.</p>\n<p>THẾ MẠNH CHUYÊN MÔN\nBệnh viện hiện tập trung vào điều trị một số nhóm bệnh ung bướu cụ thể:</p>\n<p>Tuyến vú\nTuyến giáp\nTiêu hóa\nĐầu - mặt - cổ\nBên cạnh đó, các bác sĩ tại bệnh viện vân thăm khám các nhóm bệnh thông thường gặp phải của các chuyên khoa:</p>\n<p>Tiêu hóa\nTai mũi họng\nNội tiết\nHô hấp</p>\n', '**GIỚI THIỆU**\n\nĐịa chỉ: Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội\n\nThời gian làm việc: Tất cả các ngày trong tuần (kể cả ngày lễ Tết)\n\nBuổi sáng: 07h00 - 12h00\nBuổi chiều: 13h30 - 17h00\nBệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế. \n\nĐiểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.\n\nSự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.\n\nTHẾ MẠNH CHUYÊN MÔN\nBệnh viện hiện tập trung vào điều trị một số nhóm bệnh ung bướu cụ thể:\n\nTuyến vú\nTuyến giáp\nTiêu hóa\nĐầu - mặt - cổ\nBên cạnh đó, các bác sĩ tại bệnh viện vân thăm khám các nhóm bệnh thông thường gặp phải của các chuyên khoa:\n\nTiêu hóa\nTai mũi họng\nNội tiết\nHô hấp', 'data:image/png;base64,', '2023-02-12 00:15:15', '2023-02-12 00:15:15');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(7, '42 Nghĩa Dũng, Phúc xá, Ba Đình, Hà Nội', 'Hệ thống y tế MEDLATEC', '<p><strong>GIỚI THIỆU CHUNG</strong></p>\n<p>Hệ thống y tế MEDLATEC bao gồm 01 Bệnh viện Đa khoa, 07 Phòng khám Đa khoa, 33 chi nhánh, 29 văn phòng, 50 điểm thu gom mẫu trên toàn quốc:</p>\n<p>Bệnh viện Đa khoa MEDLATEC tại 42-44 Nghĩa Dũng, Ba Đình, Hà Nội\nPhòng khám Đa khoa MEDLATEC Tây Hồ\nPhòng khám Đa khoa MEDLATEC Thanh Xuân\nPhòng khám Đa khoa MEDLATEC Vĩnh Phúc\nPhòng khám Đa khoa MEDLATEC Mê Linh\nPhòng khám Đa khoa MEDLATEC Bắc Ninh\nPhòng khám Đa khoa MEDLATEC Thanh Hóa\nPhòng khám Đa khoa MEDLATEC Cần Thơ\nCác chi nhánh, văn phòng, điểm thu gom mẫu\nBệnh viện Đa khoa MEDLATEC</p>\n<p>Địa chỉ: 42 Nghĩa Dũng, Ba Đình, Hà Nội.\nThời gian làm việc: Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.\nCác dịch vụ y tế cung cấp:\nKhám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...\nPhẫu thuật hoặc tiểu phẫu: Phẫu thuật Ung bướu, phẫu thuật Tiêu hóa, phẫu thuật Tiết niệu, phẫu thuật Nam khoa, phẫu thuật chấn thương. Điều trị tại viện: Dịch vụ đốt sóng cao tần điều trị u lành tuyến giáp.\nĐáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, MRI, CT-Scanner), thăm dò chức năng (Điện tim, Nội soi,…), xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử, Giải phẫu bệnh, Vi sinh…)\nKhám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.\nKhám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…\nKhám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc.\nTiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai,...\nPhòng khám Đa khoa tại Hà Nội và tỉnh</p>\n<p>Thời gian làm việc: Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.\nCác dịch vụ y tế cung cấp tại phòng khám đa khoa:\nKhám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...\nĐáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, CT-Scanner), thăm dò chức năng (Điện tim, Nội soi,…), xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử,...)\nKhám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.\nKhám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…\nKhám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc (áp dụng tại PKĐK MEDLATEC Tây Hồ) và Bảo lãnh viện phí (tại PKĐK MEDLATEC Vĩnh Phúc)\nTiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai (áp dụng tại PKĐK MEDLATEC Tây Hồ, MEDLATEC Thanh Xuân).\nPhục vụ lấy mẫu xét nghiệm tận nơi 24/24</p>\n<p>Thời gian: 24/24h, tất cả các ngày trong tuần, kể cả ngày Lễ/Tết.\nĐịa điểm phục vụ: Tại hệ thống văn phòng và chuỗi chi nhánh ở các tỉnh, thành phố.</p>\n', '**GIỚI THIỆU CHUNG**\n\nHệ thống y tế MEDLATEC bao gồm 01 Bệnh viện Đa khoa, 07 Phòng khám Đa khoa, 33 chi nhánh, 29 văn phòng, 50 điểm thu gom mẫu trên toàn quốc:\n\nBệnh viện Đa khoa MEDLATEC tại 42-44 Nghĩa Dũng, Ba Đình, Hà Nội\nPhòng khám Đa khoa MEDLATEC Tây Hồ\nPhòng khám Đa khoa MEDLATEC Thanh Xuân\nPhòng khám Đa khoa MEDLATEC Vĩnh Phúc\nPhòng khám Đa khoa MEDLATEC Mê Linh\nPhòng khám Đa khoa MEDLATEC Bắc Ninh\nPhòng khám Đa khoa MEDLATEC Thanh Hóa\nPhòng khám Đa khoa MEDLATEC Cần Thơ\nCác chi nhánh, văn phòng, điểm thu gom mẫu\nBệnh viện Đa khoa MEDLATEC\n\nĐịa chỉ: 42 Nghĩa Dũng, Ba Đình, Hà Nội.\nThời gian làm việc: Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.\nCác dịch vụ y tế cung cấp:\nKhám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...\nPhẫu thuật hoặc tiểu phẫu: Phẫu thuật Ung bướu, phẫu thuật Tiêu hóa, phẫu thuật Tiết niệu, phẫu thuật Nam khoa, phẫu thuật chấn thương. Điều trị