INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(8, '414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh', 'Trung tâm xét nghiệm Diag Laboratories', '<p><strong>GIỚI THIỆU CHUNG</strong></p>\n<p>Diag là một trong những trung tâm xét nghiệm uy tín tại Việt Nam với hơn 20 năm trong ngành dịch vụ y tế. Diag cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi bệnh nhân.</p>\n<p>Dàn hệ thống máy xét nghiệm tự động đảm bảo kết quả nhanh chóng và chính xác.\nSử dụng kỹ thuật lấy máu chân không - giảm cảm giác đau, giảm nguy cơ vỡ ven và vỡ hồng cầu.\nDanh mục xét nghiệm đa dạng phục vụ theo từng nhu cầu thăm khám, kiểm tra sức khỏe.\nMạng lưới cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\nCác kết quả trong phòng thí nghiệm được quản lý thông qua hệ thống nội kiểm (IQC) và ngoại kiểm (EQC) giúp quá trình xét nghiệm và trả kết quả được chính xác.\nTrung tâm xét nghiệm Diag Laboratories được trang bị phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại, dàn hệ thống máy xét nghiệm tự động hiện đại của hãng Abbott. Các trang thiết bị khác của phòng xét nghiệm Diag đều đến từ các thương hiệu nổi tiếng, hiện đại và chuẩn quốc tế như Roche, Sysmex, Thermo Fisher, Arkray.</p>\n<p>Địa chỉ: Trụ sở chính nằm tại 414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh</p>\n<p>Trung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.</p>\n<p>Thời gian làm việc:</p>\n<p>Giờ mở cửa: 6h00 mỗi ngày\nGiờ đóng cửa:\nThứ 7: 19h00 hoặc 21h00 (Tùy từng cơ sở)\nChủ nhật: 12h00 hoặc 15h00 (Tùy từng cơ sở), cơ sở Quận 10: 19h00\nHình thức thanh toán:</p>\n<p>Trung tâm nhận thanh toán: Tiền mặt, chuyển khoản, thanh toán thẻ\nTrung tâm có xuất hóa đơn đỏ trong vòng 24 giờ</p>\n', '**GIỚI THIỆU CHUNG**\n\nDiag là một trong những trung tâm xét nghiệm uy tín tại Việt Nam với hơn 20 năm trong ngành dịch vụ y tế. Diag cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi bệnh nhân.\n\nDàn hệ thống máy xét nghiệm tự động đảm bảo kết quả nhanh chóng và chính xác.\nSử dụng kỹ thuật lấy máu chân không - giảm cảm giác đau, giảm nguy cơ vỡ ven và vỡ hồng cầu.\nDanh mục xét nghiệm đa dạng phục vụ theo từng nhu cầu thăm khám, kiểm tra sức khỏe.\nMạng lưới cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\nCác kết quả trong phòng thí nghiệm được quản lý thông qua hệ thống nội kiểm (IQC) và ngoại kiểm (EQC) giúp quá trình xét nghiệm và trả kết quả được chính xác.\nTrung tâm xét nghiệm Diag Laboratories được trang bị phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại, dàn hệ thống máy xét nghiệm tự động hiện đại của hãng Abbott. Các trang thiết bị khác của phòng xét nghiệm Diag đều đến từ các thương hiệu nổi tiếng, hiện đại và chuẩn quốc tế như Roche, Sysmex, Thermo Fisher, Arkray.\n\nĐịa chỉ: Trụ sở chính nằm tại 414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh\n\nTrung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\n\nThời gian làm việc: \n\nGiờ mở cửa: 6h00 mỗi ngày\nGiờ đóng cửa: \nThứ 7: 19h00 hoặc 21h00 (Tùy từng cơ sở)\nChủ nhật: 12h00 hoặc 15h00 (Tùy từng cơ sở), cơ sở Quận 10: 19h00\nHình thức thanh toán: \n\nTrung tâm nhận thanh toán: Tiền mặt, chuyển khoản, thanh toán thẻ\nTrung tâm có xuất hóa đơn đỏ trong vòng 24 giờ\n', 'data:image/png;base64,', '2023-02-12 00:17:21', '2023-02-12 00:17:21');
INSERT INTO `clinics` (`id`, `address`, `name`, `descriptionHTML`, `descriptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(9, 'Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội', 'Hệ thống Y tế Thu Cúc TCI', '<p><strong>GIỚI THIỆU</strong></p>\n<p>Hệ thống Y tế Thu Cúc TCI tự hào là đơn vị y tế được hàng triệu người dân tin tưởng và Sở Y tế công nhận</p>\n<ul>\n<li>Huy chương vàng Dịch vụ y tế do Bộ Y tế trao tặng</li>\n<li>TOP 3 Bệnh viện tư nhân có điểm chất lượng dẫn đầu Hà Nội</li>\n<li>TOP 5 bệnh viện có điểm chất lượng cao nhất</li>\n<li>99% khách hàng đánh giá hài lòng theo thang điểm chấm của Sở Y tế</li>\n<li>Hệ thống Y tế Thu Cúc TCI quy tụ đội ngũ bác sĩ gồm đông đảo các Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ giỏi chuyên môn và giàu kinh nghiệm.</li>\n</ul>\n<p>Đại tá, Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa II, Thầy thuốc nhân dân Nguyễn Văn Quýnh: 40 năm kinh nghiệm trong chuyên khoa Tim mạch. Hơn 30 năm công tác tại Bệnh viện Trung ương Quận đội 108\nThầy thuốc ưu tú, Bác sĩ chuyên khoa II Nguyễn Thị Kim Loan: Nguyên Trưởng khoa Cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội\nTiến sĩ, Bác sĩ Nguyễn Văn Doanh: Nguyên là chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị\nTiến sĩ, Bác sĩ Nguyễn Thị Thu Hương: Nguyên Phó Giám đốc Bệnh viện Thận Hà Nội. Hơn 30 năm kinh nghiệm khám và chữa các bệnh thận, tiết niệu\nPhó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa I, Thầy thuốc nhân dân Nguyễn Xuân Thành: Hơn 30 năm kinh nghiệm trong lĩnh vực gan mật.\nVà nhiều Phó Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ uy tín khác.\nĐịa chỉ:</p>\n<ul>\n<li>Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội</li>\n<li>Cơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội</li>\n<li>Cơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội</li>\n<li>Cơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội</li>\n</ul>\n<p>Thời gian làm việc chung:</p>\n<p>Nhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc TCI triển khai giờ làm việc như sau:</p>\n<ul>\n<li>Cơ sở 286 Thụy Khuê: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7</li>\n<li>Cơ sở 216 Trần Duy Hưng: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần</li>\n<li>Cơ sở 32 Đại Từ: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần</li>\n<li>Cơ sở 136 Nguyễn Trãi: Từ 8h00 - 17h00 từ Thứ 2 đến CN hàng tuần</li>\n</ul>\n<p>Một số lưu ý</p>\n<ul>\n<li>Cơ sở 216 Trần Duy Hưng, cơ sở 32 Đại Từ, cơ sở 136 Nguyễn Trãi chỉ nhận khám và điều trị ngoại trú. Bệnh nhân cần cấp cứu hoặc có nhu cầu điều trị nội trú cần đến cơ sở 286 Thụy Khuê.</li>\n<li>Hệ thống Y tế Thu Cúc TCI có tiếp nhận thanh toán viện phí qua thẻ ngân hàng, ví điện tử Momo.</li>\n<li>Hệ thống Y tế Thu Cúc TCI có chế độ ưu tiên rõ ràng cụ thể cho các người bệnh, đảm bảo tạo thuận lợi nhất cho việc khám chữa bệnh đạt được hiệu quả. Theo đó, quy định ưu tiên người bệnh khám bệnh, chữa bệnh như sau:</li>\n<li>Ưu tiên các trường hợp cấp cứu</li>\n<li>Trẻ em dưới 6 tuổi, người khuyết tật nặng, người già 80 tuổi trở lên, người có công với cách mạng, phụ nữ có thai.</li>\n<li>Người bệnh đặt hẹn (có dấu đã đặt hẹn)</li>\n<li>Người bệnh khám các dịch vụ khác</li>\n</ul>\n', '**GIỚI THIỆU**\n\nHệ thống Y tế Thu Cúc TCI tự hào là đơn vị y tế được hàng triệu người dân tin tưởng và Sở Y tế công nhận\n\n* Huy chương vàng Dịch vụ y tế do Bộ Y tế trao tặng\n* TOP 3 Bệnh viện tư nhân có điểm chất lượng dẫn đầu Hà Nội\n* TOP 5 bệnh viện có điểm chất lượng cao nhất\n* 99% khách hàng đánh giá hài lòng theo thang điểm chấm của Sở Y tế\n* Hệ thống Y tế Thu Cúc TCI quy tụ đội ngũ bác sĩ gồm đông đảo các Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ giỏi chuyên môn và giàu kinh nghiệm.\n\nĐại tá, Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa II, Thầy thuốc nhân dân Nguyễn Văn Quýnh: 40 năm kinh nghiệm trong chuyên khoa Tim mạch. Hơn 30 năm công tác tại Bệnh viện Trung ương Quận đội 108\nThầy thuốc ưu tú, Bác sĩ chuyên khoa II Nguyễn Thị Kim Loan: Nguyên Trưởng khoa Cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội\nTiến sĩ, Bác sĩ Nguyễn Văn Doanh: Nguyên là chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị\nTiến sĩ, Bác sĩ Nguyễn Thị Thu Hương: Nguyên Phó Giám đốc Bệnh viện Thận Hà Nội. Hơn 30 năm kinh nghiệm khám và chữa các bệnh thận, tiết niệu\nPhó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa I, Thầy thuốc nhân dân Nguyễn Xuân Thành: Hơn 30 năm kinh nghiệm trong lĩnh vực gan mật.\nVà nhiều Phó Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ uy tín khác.\nĐịa chỉ:\n\n* Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội\n* Cơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội\n* Cơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội\n* Cơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội\n\nThời gian làm việc chung:\n\nNhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc TCI triển khai giờ làm việc như sau:\n\n* Cơ sở 286 Thụy Khuê: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7\n* Cơ sở 216 Trần Duy Hưng: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\n* Cơ sở 32 Đại Từ: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\n* Cơ sở 136 Nguyễn Trãi: Từ 8h00 - 17h00 từ Thứ 2 đến CN hàng tuần\n\nMột số lưu ý\n\n* Cơ sở 216 Trần Duy Hưng, cơ sở 32 Đại Từ, cơ sở 136 Nguyễn Trãi chỉ nhận khám và điều trị ngoại trú. Bệnh nhân cần cấp cứu hoặc có nhu cầu điều trị nội trú cần đến cơ sở 286 Thụy Khuê.\n* Hệ thống Y tế Thu Cúc TCI có tiếp nhận thanh toán viện phí qua thẻ ngân hàng, ví điện tử Momo.\n* Hệ thống Y tế Thu Cúc TCI có chế độ ưu tiên rõ ràng cụ thể cho các người bệnh, đảm bảo tạo thuận lợi nhất cho việc khám chữa bệnh đạt được hiệu quả. Theo đó, quy định ưu tiên người bệnh khám bệnh, chữa bệnh như sau:\n*  Ưu tiên các trường hợp cấp cứu\n* Trẻ em dưới 6 tuổi, người khuyết tật nặng, người già 80 tuổi trở lên, người có công với cách mạng, phụ nữ có thai.\n* Người bệnh đặt hẹn (có dấu đã đặt hẹn)\n* Người bệnh khám các dịch vụ khác', 'data:image/png;base64,', '2023-02-12 00:18:54', '2023-02-12 00:18:54');
