INSERT INTO `markdowns` (`id`, `contentHTML`, `contentMarkdown`, `description`, `doctorId`, `specialtyId`, `clinicId`, `createdAt`, `updatedAt`) VALUES
(2, '<p><strong>Bác sĩ chuyên khoa II Hoàng Thị Gái</strong></p>\n<ul>\n<li>\n<p>Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu TP. HCM</p>\n</li>\n<li>\n<p>Bác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễu</p>\n</li>\n<li>\n<p>Bác sĩ nhận khám mọi độ tuổi</p>\n</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>\n<p>Trưởng khoa Dinh Dưỡng, Bệnh viện Da Liễu TP.HCM</p>\n</li>\n<li>\n<p>Nguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu TP.HCM</p>\n</li>\n<li>\n<p>Hiện là Bác sĩ Da liễu, Phòng khám Da liễu Táo Đỏ</p>\n</li>\n<li>\n<p>Bác sĩ chuyên khoa da liễu, thẩm mỹ da Bệnh Viện Da Liễu TP.HCM</p>\n</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>\n<p>Tốt nghiệp Bác sĩ Chuyên khoa II, chuyên ngành Da liễu, Đại học Y dược TP.HCM</p>\n</li>\n<li>\n<p>Tốt nghiệp Bác sĩ Chuyên khoa I, chuyên ngành Da liễu, Đại học Y dược TP.HCM</p>\n</li>\n<li>\n<p>Tốt nghiệp Bác sĩ Đa khoa, Đại học Y dược TP.HCM</p>\n</li>\n<li>\n<p>Tham gia lớp Sơ bộ DInh dưỡng, Đại học Y khoa Phạm Ngọc Thạch</p>\n</li>\n</ul>\n<p><strong>Thành viên các Hội khoa học, tổ chức chuyên môn</strong></p>\n<ul>\n<li>Hội viên chi hội Da Liễu Hồ Chí Minh</li>\n<li>Hội viên Hội Da Liễu Việt Nam</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<p><strong>Bác sĩ khám và điều trị:</strong></p>\n<ul>\n<li>Mụn trứng cá: mụn viêm, bọc, nang, mụn đầu trắng, đâu đen</li>\n<li>Nám, sạm da: nám, sạm da mặt</li>\n<li>Rụng tóc, da dầu: mụn trứng cá, sẹo lồi, sẹo thâm, sẹo mụn</li>\n<li>Mề đay: tóc gàu, vảy, rụng tóc từng phần, lan tỏa</li>\n<li>Viêm da cơ địa: mảng da đỏ, ngứa nhiều, từng cơn</li>\n<li>Viêm da dị ứng: mẩn đỏ da, ngứa, lan tỏa</li>\n<li>Thủy đậu: mụn nước, ngứa, kèm sốt nhẹ, mệt mỏi</li>\n<li>Zona: mang mụn nước, 1 bên người, đau nhức</li>\n<li>Da nhờn, lỗ chân lông to</li>\n<li>Vảy nến: mảng đổ da, tróc vảy, có thể toàn thân</li>\n<li>Ghẻ ngứa: ngứa về đêm, vùng nếp, kẽ ngón tay, ngón chân</li>\n<li>Rạn da: da đùi, da rạn teo, bụng, nếp bẹn, nách, lưng</li>\n<li>Lão hóa da: da đổi màu, nhão, xệ, nến nhăn, sần</li>\n<li>Da đồi mồi: đốm nâu</li>\n<li>Pemphigus: bóng nước thân mình, niêm mạc</li>\n<li>Lupus ban đỏ: hồng ban cánh bướm mặt, đau nhức mỏi cơ xương khớp</li>\n<li>Xơ cứng bì: da cứng, không đều màu</li>\n<li>Nấm da: da đỏ quằn quện, các vùng da, tóc, nếp da</li>\n<li>Viêm da tiếp xúc: da đỏ, rát, nhạy cảm, tiếp xúc kiến ba khoang</li>\n<li>Viêm da do nhiễm Corticoid, nhạy cảm: da đỏ, giãn mạch, mãng, nhạy cảm, nôi mụn</li>\n<li>Nấm móng</li>\n</ul>\n<p><strong>Một số hình ảnh phòng khám:</strong></p>\n<p><img src=\"https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/46195.jpg?raw=true\" alt=\"img\"></p>\n', '\n **Bác sĩ chuyên khoa II Hoàng Thị Gái**\n\n\n* Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu TP. HCM\n\n* Bác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễu\n\n* Bác sĩ nhận khám mọi độ tuổi\n\n**Quá trình công tác**\n\n* Trưởng khoa Dinh Dưỡng, Bệnh viện Da Liễu TP.HCM\n\n* Nguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu TP.HCM\n\n* Hiện là Bác sĩ Da liễu, Phòng khám Da liễu Táo Đỏ\n \n* Bác sĩ chuyên khoa da liễu, thẩm mỹ da Bệnh Viện Da Liễu TP.HCM\n\n**Quá trình đào tạo**\n\n* Tốt nghiệp Bác sĩ Chuyên khoa II, chuyên ngành Da liễu, Đại học Y dược TP.HCM\n\n* Tốt nghiệp Bác sĩ Chuyên khoa I, chuyên ngành Da liễu, Đại học Y dược TP.HCM\n \n* Tốt nghiệp Bác sĩ Đa khoa, Đại học Y dược TP.HCM\n \n* Tham gia lớp Sơ bộ DInh dưỡng, Đại học Y khoa Phạm Ngọc Thạch\n\n**Thành viên các Hội khoa học, tổ chức chuyên môn**\n\n* Hội viên chi hội Da Liễu Hồ Chí Minh\n* Hội viên Hội Da Liễu Việt Nam\n\n**Khám và điều trị**\n\n**Bác sĩ khám và điều trị:**\n\n* Mụn trứng cá: mụn viêm, bọc, nang, mụn đầu trắng, đâu đen\n* Nám, sạm da: nám, sạm da mặt\n* Rụng tóc, da dầu: mụn trứng cá, sẹo lồi, sẹo thâm, sẹo mụn\n* Mề đay: tóc gàu, vảy, rụng tóc từng phần, lan tỏa\n* Viêm da cơ địa: mảng da đỏ, ngứa nhiều, từng cơn\n* Viêm da dị ứng: mẩn đỏ da, ngứa, lan tỏa\n* Thủy đậu: mụn nước, ngứa, kèm sốt nhẹ, mệt mỏi\n* Zona: mang mụn nước, 1 bên người, đau nhức\n* Da nhờn, lỗ chân lông to\n* Vảy nến: mảng đổ da, tróc vảy, có thể toàn thân\n* Ghẻ ngứa: ngứa về đêm, vùng nếp, kẽ ngón tay, ngón chân\n* Rạn da: da đùi, da rạn teo, bụng, nếp bẹn, nách, lưng\n* Lão hóa da: da đổi màu, nhão, xệ, nến nhăn, sần\n* Da đồi mồi: đốm nâu\n* Pemphigus: bóng nước thân mình, niêm mạc\n* Lupus ban đỏ: hồng ban cánh bướm mặt, đau nhức mỏi cơ xương khớp\n* Xơ cứng bì: da cứng, không đều màu\n* Nấm da: da đỏ quằn quện, các vùng da, tóc, nếp da\n* Viêm da tiếp xúc: da đỏ, rát, nhạy cảm, tiếp xúc kiến ba khoang\n* Viêm da do nhiễm Corticoid, nhạy cảm: da đỏ, giãn mạch, mãng, nhạy cảm, nôi mụn\n* Nấm móng\n\n**Một số hình ảnh phòng khám:**\n\n![img](https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/46195.jpg?raw=true)', 'Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu TP.HCM\nNguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu TPHCM\nBác sĩ Gái có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễu\nBác sĩ nhận khám mọi độ tuổi', 31, NULL, NULL, '2023-01-27 23:15:58', '2023-01-28 15:48:13'),
(3, '<p><strong>Bác sĩ Chuyên khoa I Nguyễn Văn Nam</strong></p>\n<p>Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần\nHiện đang công tác tại Bệnh viện Tâm thần TP. HCM\nThực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp\n<strong>Khám và điều trị</strong>\nBác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:</p>\n<ul>\n<li>Các rối loạn tâm thần cấp tính do stress, do nghiện chất (chất kích thích, ma túy, rượu),tâm thần phân liệt, do bệnh động kinh</li>\n<li>Các rối loạn cảm xúc như trầm cảm, hưng cảm, rối loạn lưỡng cực</li>\n<li>Rối loạn giấc ngủ</li>\n<li>Mất ngủ</li>\n<li>Rối loạn stress</li>\n<li>Sang chấn sau stress</li>\n<li>Đau đầu do căng thẳng</li>\n<li>Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ</li>\n<li><strong>Quá trình công tác</strong></li>\n<li>Công tác tại phòng Kế hoạch tổng hợp, Bệnh viện Tâm thần TP. HCM (2004 - nay)</li>\n<li>Quản lý chương trình quốc gia tâm thần và động kinh 24 quận - huyện thuộc TP. HCM</li>\n<li>Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ ở các trường khuyết tật</li>\n<li>Khám sức khỏe tâm thần cho các trung tâm cai nghiện</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Bác sĩ Chuyên khoa I ngành Tâm thần, Đại học Y dược TP. HCM (2010 - 2012)</li>\n<li>Thực tập chương trình FFI (Faisant fonction d’interne) chuyên ngành Tâm thần tại Bệnh viện TENON quận 20, Cộng hòa Pháp (2007 - 2008)</li>\n<li>Bác sĩ Y khoa, Trường Đại học Y khoa Phạm Ngọc Thạch (1998 - 2004)</li>\n<li>Sách, các công trình nghiên cứu và báo cáo khoa học</li>\n</ul>\n<p><strong>Các nghiên cứu khoa học đã tham gia:</strong></p>\n<ul>\n<li>Tuân thủ điều trị thuốc của bệnh nhân tâm thần phân liệt đang điều trị tại cộng đồng TP. HCM (2016 - 2017)</li>\n<li>Khảo sát hiệu quả liệu pháp gia đình trên bệnh nhân tâm thần phân liệt tại cộng đồng TP. HCM (2014 - 2015)</li>\n<li>Nghiên cứu các rối loạn tâm thần trên bệnh nhân động kinh cơn lớn đang điều trị tại cộng đồng TP. HCM (2013)</li>\n<li>Khảo sát khoảng thời gian loạn thần không điều trị (DUP) và các yếu tố liên quan trên bệnh nhân loạn thần đến khám tại Bệnh viện Tâm thần TP. HCM (2011 - 2012)</li>\n<li>Khảo sát phản ứng tâm lý bệnh nhân tâm thần phân liệt đối với các định kiến xã hội tại TP. HCM (2006)</li>\n</ul>\n', '\n**Bác sĩ Chuyên khoa I Nguyễn Văn Nam**\n\nGần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần\nHiện đang công tác tại Bệnh viện Tâm thần TP. HCM\nThực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp\n**Khám và điều trị**\nBác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:\n\n* Các rối loạn tâm thần cấp tính do stress, do nghiện chất (chất kích thích, ma túy, rượu),tâm thần phân liệt, do bệnh động kinh\n* Các rối loạn cảm xúc như trầm cảm, hưng cảm, rối loạn lưỡng cực\n* Rối loạn giấc ngủ\n* Mất ngủ\n* Rối loạn stress\n* Sang chấn sau stress\n* Đau đầu do căng thẳng\n* Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ\n* **Quá trình công tác**\n* Công tác tại phòng Kế hoạch tổng hợp, Bệnh viện Tâm thần TP. HCM (2004 - nay)\n* Quản lý chương trình quốc gia tâm thần và động kinh 24 quận - huyện thuộc TP. HCM\n* Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ ở các trường khuyết tật\n* Khám sức khỏe tâm thần cho các trung tâm cai nghiện\n\n**Quá trình đào tạo**\n* Bác sĩ Chuyên khoa I ngành Tâm thần, Đại học Y dược TP. HCM (2010 - 2012)\n* Thực tập chương trình FFI (Faisant fonction d’interne) chuyên ngành Tâm thần tại Bệnh viện TENON quận 20, Cộng hòa Pháp (2007 - 2008)\n* Bác sĩ Y khoa, Trường Đại học Y khoa Phạm Ngọc Thạch (1998 - 2004)\n* Sách, các công trình nghiên cứu và báo cáo khoa học\n\n**Các nghiên cứu khoa học đã tham gia:**\n\n* Tuân thủ điều trị thuốc của bệnh nhân tâm thần phân liệt đang điều trị tại cộng đồng TP. HCM (2016 - 2017)\n* Khảo sát hiệu quả liệu pháp gia đình trên bệnh nhân tâm thần phân liệt tại cộng đồng TP. HCM (2014 - 2015)\n* Nghiên cứu các rối loạn tâm thần trên bệnh nhân động kinh cơn lớn đang điều trị tại cộng đồng TP. HCM (2013)\n* Khảo sát khoảng thời gian loạn thần không điều trị (DUP) và các yếu tố liên quan trên bệnh nhân loạn thần đến khám tại Bệnh viện Tâm thần TP. HCM (2011 - 2012)\n* Khảo sát phản ứng tâm lý bệnh nhân tâm thần phân liệt đối với các định kiến xã hội tại TP. HCM (2006)', 'Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần\nHiện đang công tác tại Bệnh viện Tâm thần TP. HCM\nThực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp', 27, NULL, NULL, '2023-01-28 15:19:55', '2023-01-28 15:47:52'),
